words.meaning:
мера, мероприятие; распоряжение чем-л.; действие;
措置を取る(講ずる) принимать меры; перен. делать шаг;
措置よろしくを得る делать правильный шаг, поступать правильно;
措置を行う проводить мероприятие;
軍縮への最初の措置 первый шаг к разоружению.

1) утюг;
…にこてをあてる гладить (бельё и т. п.);
2) щипцы для завивки волос;
髪にこてをあてる завивать волосы;
3) стр. мастерок, кельма, лопатка;
…をこてで塗る, …にこてをあてる штукатурить что-л.;
4) паяльник.

1) ставить, устанавливать;
土台を据える заложить фундамент;
腰を据える а) усесться; б) долго сидеть за чем-л.;
目を据えて見る уставиться на кого-что-л.;
2) усаживать кого-л.;
3) назначать на должность;
…のあとがまに据える назначать в качестве преемника…;
4) применять (лечебное прижигание);
5) ставить (штамп, печать).

метла; веник;
箒で掃く мести метлой;
あんな男は箒で掃くほどある такими, как он, хоть пруд пруди.

1): ～の обыкновенный, обычный, нормальный;
彼にはどこが尋常でない所がある в нём есть что-то своеобразное;
2): ～な правильный; честный;
尋常に白状する честно (открыто) признаваться.
